import React from 'react';
import '../styles/Home.css';

const Home = () => {
  return (
    <section id="home">
      <h1 style={{ fontSize: '48px', color: '#333' }}>Welcome to My Portfolio</h1>
      <h2 style={{ fontSize: '24px', color: '#666' }}>Building Innovative Solutions with Passion and Precision</h2>
      <p style={{ fontSize: '18px', color: '#999' }}>
        I'm Mohammed Ikram Ashrafi, a Full-Stack Developer & DevOps Engineer with a passion for delivering high-quality solutions that exceed expectations.
      </p>
    </section>
  );
};

export default Home;
